            WriteLiteral(@"					<p >
						İstanbul… Şarkılara, şiirlere, romanlara konu olmuş bir kültür ve tarih mozaiği… 
                        Dünyada eşi benzeri bulunmayan ve Avrupa ile Asya kıtaları üzerinde tarihi ve kültürel dokusuyla göz kamaştıran camiler, saraylar, parklar ve köşkler şehri İstanbul’u keşfetmek çok heyecanlı ve eğlenceli olacaktır. 
                        Aşağıda İstanbul ile ilgili faydalı bilgileri bulabilirsiniz…
					</p>
");
            WriteLiteral(@"				    <p>
					Bizans, Konstantiniye ve İstanbul… 
                    Bu üç sihirli isim İstanbul’un güz kamaştıran tarihini simgelemektedir. 
                    Dünya’da çok az şehir bu kadar özel ve keşfetmesi çok heyecan vericidir. 
                    İstanbul, tarih boyunca 120 kayser ve imparator tarafından yönetilmiş ve yukarıda anılan üç büyük medeniyete ev sahipliği yapmıştır.
				    </p>
				    <p>
					    İstanbul’un Tarihi Yarımadası olarak bilinen kent merkezinde ilk yerleşim yeri,
                        Yunanlılar tarafından İ.Ö. 685 yılında kurulmuş ve buraya “Byzantion” adı verilmiş.
                        Tarih boyunca farklı uygarlıklarca değişik isimlerle anılmış olan Tarihi Yarımada,
                        Osmanlı İmparatorluğu döneminde ise ilk olarak Dersaadet ve sonrasında da İstanbul olarak anılmıştır.
					    İstanbul aktiviteleri sınırsızdır. 
                        İstanbul, muhteşem doğal güzellikleri, gökyüzüne uzanan minareleri,
                        al");
            WriteLiteral(@"tın yaldızlı kubbeleri, sarayları, köşkleri, müzeleri, park ve bahçeleri, anıtları, kuleleri,
                        kültürü ve çok daha fazlasıyla ziyaretçilerini büyülemektedir.
                        Asya ve Avrupa kıtalarını birleştiren özelliğiyle de dünyada eşsizdir.
                        Ve özellikle Boğaziçi-İstanbul Boğazı sizleri derinlemesine etkileyecektir.
                        Roma, Bizans ve Osmanlı İmparatorluğu’nun tarihi eserlerine İstanbul’un eşsiz doğal güzellikleri
                        de eklenince ortaya muhteşem bir tablo çıkmaktadır.
				    </p>
					<p>
						Türkiye’nin en büyük ve popüler şehri olmasının yanında İstanbul, sanat, kültür ve ekonomi alanında da aynı zamanda 15 milyonluk nüfusu ile Türkiye ve dünyanın en büyük kentlerinden birisidir.

						İstanbul’da gezilecek yerler de sınırsızdır. 
                        İstanbul’un ilk bakışta göze çarpan en etkileyici yerleri Tarihi Yarımada ve Boğaziçi’dir. 
                        Topkapı Sarayı, Ayasofya ");
            WriteLiteral(@"ve Sultanahmet Camii, Kapalıçarşı, Yerebatan Sarnıcı gibi tarihi yerleri barındıran Tarihi Yarımadada gezi ve Eminönü Galata Köprüsünden 
                        başlayarak Anadolu Kavağı’na kadar süren etkileyici İstanbul Boğaz turu, İstanbul’un ziyaretçilerinin mutlaka yapması gereken gezi aktivitelerinin başında gelmektedir.
                        Avrupa ve Asya’yı ayıran İstanbul Boğazı’nda vapur veya teknelerle geleneksel ve unutulmaz bir deniz gezisi yapmadan İstanbul geziniz tamamlanmış sayılmaz.
					</p>
					<p>
